import react from 'react'
import ReactDom from 'react-dom'
var cur = new Date()
const greet = ""
const cssstyle = {}
if (cur.getHours() >= 1 && cur.getHours() <= 11) {
  greet = "Morning"
  cssstyle.color = "green"
}
else if (cur.getHours() > 11 && cur.getHours() <= 19) {
  greet = "Evening"
  cssstyle.color = "red"
}
else {
  greet = "Night"
  cssstyle.color = "blue"
}
